    "When this option is set, skip the additional run of loop closing after computing the principal graphs to identify potential loop structure in the data space.": "当设置此选项时，在计算主图以识别数据空间中的潜在循环结构后，将跳过循环闭合的额外运行。",
    "The maximal ratio between the euclidean distance of two tip nodes in the spanning tree inferred from SimplePPT algorithm and that of the maximum distance between any connecting points on the spanning tree allowed to be connected during the loop closure procedure.": "在由SimplePPT算法推断出的生成树中，两个末端节点之间的欧几里得距离与在循环闭合过程中允许连接的生成树上任何连接点之间的最大距离之比的最大值。",
    "The minimal ratio between the geodestic distance of two tip nodes in the spanning tree inferred from SimplePPT algorithm and that of the length of the diameter path on the spanning tree allowed to be connected during the loop closure procedure. (Both euclidean_distance_ratio and geodestic_distance_ratio need to be satisfied to introduce the edge for loop closure.)": "在闭环过程中，由SimplePPT算法推断出的生成树中两个顶端节点的测地距离与生成树直径路径长度之间的最小比率。（为了在闭环中引入边，需要满足欧几里得距离比率和测地距离比率。）",
