    "Define the text pattern to identify the decoy proteins and/or PSMs, set this up if the label that identifies the decoys in the database is not the default (by default : random) (Only valid if option -A  is active)": "定义用于识别诱饵蛋白和/或PSMs（肽段谱匹配）的文本模式，并设置此模式，如果用于在数据库中识别诱饵的标签不是默认值（默认值：random）（仅当激活选项-A时有效）",
    "Reduce the tree of proteins (removing low scored proteins) in order to estimate alpha,beta and gamma faster.(Only valid if option -A is active)": "为了更快地估算 alpha、beta 和 gamma，减少蛋白质树（移除低分蛋白质）。（仅当激活 -A 选项时有效）",
    "Use target decoy competition to compute peptide probabilities.(recommended when using -A)": "使用目标-诱饵竞争来计算肽概率。（推荐在使用-A时使用）",
    "Q-value threshold that will be used in the computation of the MSE and ROC AUC score in the grid search (recommended 0.05 for normal size datasets and 0.1 for big size datasets).(Only valid if option -A is active)": "在网格搜索中计算均方误差(MSE)和接收者操作特征曲线下面积(ROC AUC)得分时使用的Q值阈值（对于一般大小的数据集推荐使用0.05，对于大型数据集推荐使用0.1）。（仅当激活选项-A时有效）",
    "Proteins with a very low score (&lt; 0.001) will be truncated (assigned 0.0 probability).(Only valid if option -A is active)": "得分非常低的蛋白质（< 0.001）将被截断（分配0.0的概率）。（仅当激活选项-A时有效）",
    "Uses protein group level inference, each cluster of proteins is either present or not, therefore when grouping proteins discard all possible combinations for each group.(Only valid if option -A is active and -N is inactive)": "使用蛋白质组水平推断，每个蛋白质簇要么存在要么不存在，因此在对蛋白质进行分组时，丢弃每个组的所有可能组合。（仅当激活选项-A且未激活-N时有效）",
